    return (
        <>
            <div className="container-fluid bg-light">
                <div className="row text-center bg-light pt-5">
                    <div className="col-md-6">
                        <h2 className="text-primary"><u>Ask us how we can help you?</u></h2>
                    </div>
                
                    <div className="col-md-6">
                        <h4>I'm ready to start building or already have my own ecommerce store.</h4> <br />
                        <span><button className="btn btn-primary mt-2">TRY BIGCOMMERCE</button></span>
                    </div>
                    </div>
            </div>
        </>
    );
}

export default About;
